import {img} from '../../assets/certificates/imgCertificates.js';


function Certificate (){
    return(
        <section className='section-home'>
            <ul>
                <li><img src={img[0].img} alt={img[0].alt}/></li>
            </ul>
        </section>
    );
}

export {Certificate};
